
local function anti_deobfuscation()
    local function destroy_if_tampered()
        local original_hash = "secure_hash_value"
        local function get_hash()
            return tostring(math.random(1, 9999999))
        end

        if get_hash() ~= original_hash then
            warn("ðŸš¨ Tampering Detected! Destroying Script! ðŸš¨")
            while true do end
        end
    end

    local function block_bytecode_dump()
        local old_dump = string.dump
        string.dump = function(...)
            warn("ðŸš¨ Bytecode Dumping Attempt Detected! ðŸš¨")
            return nil
        end
    end

    local function fake_instructions()
        local junk = {math.random(), tostring(math.random()), string.reverse("random")}
        for i = 1, 100 do junk[i] = junk[i-1] end
    end

    destroy_if_tampered()
    block_bytecode_dump()
    fake_instructions()
end

anti_deobfuscation()


local function detect_spy()
    local mt = getrawmetatable(game)
    local old_index = mt.__index
    local old_namecall = mt.__namecall

    setreadonly(mt, false)

    mt.__index = newcclosure(function(self, key)
        if key == "FireServer" or key == "InvokeServer" then
            warn("ðŸš¨ Possible Spy Tool Detected: Blocking attempt!")
            return function(...) return nil end
        end
        return old_index(self, key)
    end)

    mt.__namecall = newcclosure(function(self, ...)
        local args = {...}
        local method = getnamecallmethod()
        if method == "FireServer" or method == "InvokeServer" then
            warn("ðŸš¨ Blocked Spy Hook on " .. tostring(self))
            return nil
        end
        return old_namecall(self, unpack(args))
    end)

    setreadonly(mt, true)
end

detect_spy()


local function anti_debug()
    local success, msg = pcall(function() error("Debugger Detected") end)
    if success then
        while true do end
    end
end

local function decode_b64_zlib(data)
    local b='ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/'
    data = data:gsub("[^"..b.."=]", "")
    local decoded = (data:gsub('.', function(x)
        if x == '=' then return '' end
        local r, f = '', (b:find(x) - 1)
        for i = 6, 1, -1 do r = r .. (f % 2^i - f % 2^(i-1) > 0 and '1' or '0') end
        return r
    end):gsub('%d%d%d?%d?%d?%d?%d?%d?%d?', function(x)
        if #x ~= 8 then return '' end
        local c = 0
        for i = 1, 8 do c = c + (x:sub(i, i) == '1' and 2^(8-i) or 0) end
        return string.char(c)
    end))
    return loadstring(require("zlib").decompress(decoded))()
end

anti_debug()
